import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState(null);
  useEffect(() => {
    fetch("/api")
      .then((response) => response.json())
      .then(setData(response));    
  });


  return (
    <div className="App">
      <header className="App-header">
      <p>{data.message}</p> 
      </header>
    </div>
  );

}

export default App;
